import React, { useEffect, useState } from 'react'
import { useNavigate } from 'react-router-dom'
import NavbarComp from '../Navbar/NavbarComp'
import { createAxios, getTokenFromLocalStorage } from '../../Hooks/UseAxios'
import Table from 'react-bootstrap/Table'
import styled from 'styled-components/macro'
import 'react-pro-sidebar/dist/css/styles.css'
import Form from 'react-bootstrap/Form'

const ErrorBox = styled.div`
  height: 30px;
  margin: 1rem 0;
  /* border: 1px solid red; */
  color: red;
  width: 100%;
  padding: 2px 0;
  text-align: center;
`

const Container = styled.section`
  /* border: 1px solid olive; */
  max-width: 1000px;
  margin: 0 auto;
  box-sizing: border-box;
  margin-top: 5rem;
  min-height:82vh ;
`

const Footer = styled.footer`
  background-color: #212529;
  height: 3.6vh;
`

export default function AllTransactions() {
  const navigate = useNavigate()
  const token = getTokenFromLocalStorage()
  const [error, setError] = useState(false)
  const [errorMessage, setErrorMessage] = useState('')
  const [transactions, setTransactions] = useState()
  const [username, setUserName] = useState('')

  //check user role
  const user = localStorage.getItem('user')
  const parsedUser = JSON.parse(user)
  const userRole = parsedUser?.user?.role[0]?.roleName
  useEffect(() => {
    if (!user || userRole !== 'Admin') {
      navigate('/')
    }
  }, [userRole])

  const handleSubmit = async (e) => {
    e.preventDefault()

    if(!username){
      setError(true)
      setErrorMessage("Field cannot be empty!")
      return
    }

    console.log(username)
    const token = parsedUser.jwtToken
    const apiUrl = 'http://localhost:8080'
    const authAxios = createAxios(apiUrl, token)

    const getUser = await authAxios.get(`/users/${username}`)
    console.log(getUser?.data)
    if (getUser?.data) {
      setError(false)
      setErrorMessage('')
      const data = await authAxios.get(`/transactions/${username}`)
      console.log(data?.data)
      setTransactions(data?.data)
    } else {
      setError(true)
      setErrorMessage('User not found!')
    }
  }

  return (
    <>
      <NavbarComp />
      <Container>
        <Form>
          <Form.Group className='col-md-6' style={{ display: 'inline-block' }}>
            <Form.Label>Username</Form.Label>
            <Form.Control
              type='text'
              value={username}
              onChange={(e) => {
                setUserName(e.target.value)
                setError(false)
                setErrorMessage('')
              }}
            />
          </Form.Group>

          <button
            type='submit'
            className='btn btn-primary'
            onClick={handleSubmit}
            style={{marginLeft:'5rem'}}
          >
            Details
          </button>

          <ErrorBox>{error && errorMessage}</ErrorBox>
        </Form>
        <Table striped bordered hover variant='light'>
          <thead>
            <tr>
              <th>ID</th>
              <th>Amount</th>
              <th>Beneficiary Account Number</th>
              <th>Created By</th>
              <th>Created Date Time</th>
              <th>Sender Account Number</th>
              <th>Type</th>
            </tr>
          </thead>
          <tbody>
            {transactions?.map((item) => {
              return (
                <tr key={item.id}>
                  <td>{item.id}</td>
                  <td>{item.amount}</td>
                  <td>
                    {item.benificiaryAccountNumber !== null ? (
                      item.benificiaryAccountNumber
                    ) : (
                      <>NA</>
                    )}
                  </td>
                  <td>{item.createdBy}</td>
                  <td>{item.createdDateTime}</td>
                  <td>
                    {item.senderAccountNumber !== null ? (
                      item.senderAccountNumber
                    ) : (
                      <>NA</>
                    )}
                  </td>
                  <td>{item.type}</td>
                </tr>
              )
            })}
          </tbody>
        </Table>
      </Container>
      <Footer></Footer>
    </>
  )
}
